Consultar distancias recorridas y conocer los últimos eventos generados por los vehículos.

Vea en un mapa la ubicación de toda su flota, con vistas de mapa Standard Road, Transito, Satélite, e Híbrido entre los más destacados.

Tenga la información de sus vehículos actualizada:

- Ubicación actual;
-Histórico de recorrido;
- Velocidad y Sentido de circulación;
- Fecha y hora de la última actualización;
-Búsqueda de vehículos por chapa/número;
-Información detallada a tiempo real de velocidad;
-Aviso de NOTIFICACIONES PUSH;
-Geolocalización;
-Resumen de recorrido,
- Ubicación desde el dispositivo móvil hasta el vehículo;
- Botón de pago del servicio, etc…

